(82087, 'deDE', 'Fackelwurf', 'Gewinnt das Fackelwurfspiel und sprecht anschlieend mit dem Feuerschluckmeister.', 'Ihr wollt also $gFeuerjongleur:Feuerjongleurin; werden? Denkt Ihr, dass Ihr das Zeug dazu habt? Die Geschicklichkeit? Die Reflexe? ...Den Mut? Wenn ja, dann wollen wir Euch mal auf die Probe stellen!$B$BStellt Euch neben das Feuer, dann seht Ihr Kohlenpfannen, ber denen blinkende Markierungen schweben. Die msst Ihr mit einer Fackel treffen. Seid schnell! Um fr einen Wurf Punkte zu bekommen, msst Ihr die Fackel werfen, bevor die Markierung verschwindet!$B$BTrefft genug markierte Kohlenpfannen und kommt dann hierher zurck... um Eure nchste Lektion zu erhalten.', '', '', '', '', '', 'Kehrt zum Feuerschluckmeister zurck.', 55664),
(82080, 'deDE', 'Noch einmal Fackeln werfen', 'Gewinnt das Fackelwurfspiel und sprecht anschlieend mit dem Feuerschluckmeister.', 'Seid gegrt, $gFeuerjongleur:Feuerjongleurin;! Macht es Euch Spa, wenn Ihr Flammen wild umherwirbeln lasst? Das hrt man doch gerne! Nun, haltet Ihr Euch fr $geinen Experten:eine Expertin; in Sachen Fackelwrfe? Dann will ich Euch auf die Probe stellen...$B$BIhr kennt die Regeln: Werft die Fackeln auf die markierten Kohlenpfannen. Doch dieses Mal geht es auf Zeit und es gilt VIEL mehr Kohlenpfannen zu treffen.$B$BBereit?', '', '', '', '', '', 'Kehrt zum Feuerschluckmeister zurck.', 55664),
