(81565, 'deDE', 'Eine weitere Runde Nudeln', 'Sprecht mit Gromeister Jakkus, um das Szenario Nudelzeit abzuschlieen.', 'Nudelnachschlag gefllig?\n\nKein Problem. Ihr msst es nur sagen, dann bringe ich Euch erneut in eine Version der Vergangenheit, in der Ihr Euren eigenen Nudelstand hattet.', '', '', '', '', '', '', 55664),
(81564, 'deDE', 'Eine Geschichte ber Nudeln', 'Sprecht mit Gromeister Jakkus, um das Szenario Die Geheimzutat abzuschlieen.', 'Ah, wieder hier zu sein, macht mich glatt hungrig. Habe ich Euch je davon erzhlt, wie ich unter Sungshin Eisentatz die Kochkunst erlernt habe?\n\nVielleicht kommt Ihr ja selbst in den Genuss. Ihr msst es nur sagen, dann bringe ich Euch in eine Version dieser Zeitlinie, in der Ihr... ja, IHR... Euren eigenen Nudelstand betrieben habt!\n\nAlles begann mit dem Geheimrezept der Familie Lin...', '', '', '', '', '', '', 55664),
