(80380, 'deDE', 'Mantel und Nadel', 'Legt Euren Umhang des ewigen Potenzials an und sammelt einen Faden der Macht von einem ewigen Verheerer.', 'Sobald Ihr den Umhang anlegt, wird es Euch mglich sein, an Gegnern Fden wahrzunehmen.\n\nDer Umhang wird ganz von selbst diese Fden absorbieren und so Eure Macht dauerhaft erhhen.\n\nVersucht, einen Faden von den ewigen Verheerern in der Nhe zu sammeln.', '', '', '', '', '', '', 55664),
(80349, 'deDE', 'Zeit, zurckzukehren', 'Kehrt zu Moratari zurck.', 'Ihr macht Euch jetzt besser auf den Weg. Das Portal sollte Euch ins Dorf zurck bringen.', '', '', '', '', '', 'Kehrt zu Moratari in Pel\'zin zurck.', 55664),
(80320, 'deDE', 'Helft den Klaxxi', '', '', '', '', '', '', '', '', 55664),
(80197, 'deDE', 'Edelsteine kombinieren', 'Nutzt drei gesprungene tdliche Saphire, um sie zu einem fehlerhaften tdlichen Saphir zu kombinieren.', 'Prismatische Edelsteine knnen zu mchtigeren Edelsteinen kombiniert werden.\n\nKombiniert drei gesprungene tdliche Saphire, um einen fehlerhaften tdlichen Saphir zu erschaffen, der zustzlichen kritischen Trefferwert gewhrt, wenn Ihr ihn sockelt.', '', '', '', '', '', '', 55664),
(80196, 'deDE', 'Edelsteine extrahieren', 'Extrahiert den gesprungenen tdlichen Saphir aus Eurer Ausrstung.', 'Jeder Edelstein kann mit der Fhigkeit \'Edelstein extrahieren\' aus Eurer Ausrstung entfernt werden.\n\nDer Edelstein wird nicht zerstrt.\n\nExtrahiert jetzt einen Edelstein.', '', '', '', '', '', '', 55664),
(80018, 'deDE', 'Todschickes Fliegen', 'Benutzt das Podium der Transformation.', 'Ihr habt alles gelernt, was ich Euch beibringen kann.\n\nAber beim Fliegen geht es nicht nur darum, Euer Ziel zu erreichen, sondern auch darum, stilvoll dort anzukommen!\n\nBenutzt das Podium der Transformation hinter Euch, um das Aussehen Eures Drachen anzupassen.', '', '', '', '', '', '', 55664),
(80017, 'deDE', 'Hhenrausch', 'Fliegt durch die Ringe und landet im Zielgebiet.', 'Setzt \'Aufstieg gen Himmel\' ein, um an Hhe zu gewinnen.\n\nFolgt den Ringen erneut, um Euer Ziel zu erreichen, und setzt \'Aufstieg gen Himmel\' ein, wenn Ihr Schwung nach oben braucht.\n\nWenn Ihr nicht weiterkommt, setzt die bronzene Taschenuhr ein, dann setzt Celormu Euch zurck.', '', '', '', '', '', '', 55664),
(80016, 'deDE', 'Geschwindigkeitsrausch', 'Fliegt durch die Ringe und landet im Zielgebiet.', 'Manchmal werdet Ihr weitere Strecken zurcklegen mssen.\n\nWenn Ihr keine Hindernisse berwinden msst, ist \'Vorwrtsschub\' die einfachste Mglichkeit, eine gute Geschwindigkeit beizubehalten, damit Ihr nicht abstrzt.\n\nFolgt wieder den Ringen zum Ziel und nutzt \'Vorwrtsschub\', wenn Ihr aufgefordert werdet, Eure Geschwindigkeit zu halten.\n\nWenn Ihr feststeckt, nutzt die bronzene Taschenuhr, dann wird Celormu Euch zurcksetzen.', '', '', '', '', '', '', 55664),
(80015, 'deDE', 'Drachensturzflug leicht gemacht', 'Fhrt einen Sturzflug aus, gleitet dann durch die Ringe und landet im Zielgebiet.', 'Gleitend erreicht Ihr das gewnschte Ziel. Aber was, wenn Ihr schneller ankommen wollt?\n\nDurch den Sturzflug von einem hohen Punkt erhaltet Ihr einen Geschwindigkeitsschub. Wenn Ihr das Fliegen beherrscht, knnt Ihr Euren Schwung beibehalten und nach einem Sturzflug etwas an Hhe gewinnen.\n\nFliegt durch die Ringe zum Zielort.\n\nWenn Ihr irgendwo festhngt, benutzt die bronzene Taschenuhr und Celormu wird Eure Position zurcksetzen.', '', '', '', '', '', '', 55664),
(80013, 'deDE', 'Drachenflug leicht gemacht', 'Beschwrt Euren Reitdrachen oder steigt auf den roten Drachen. Gleitet anschlieend durch die Ringe und landet im Zielgebiet.', 'Fangen wir mit den Grundlagen an.\n\nWenn Ihr geradeaus fliegt, werdet Ihr sehr schnell erschpft sein. Nutzt die Schwerkraft und zielt leicht nach unten, um eine lange Strecke zu fliegen. Die Ringe zeigen Euch den allgemeinen Winkel an, den Ihr fr den einfachen Gleitflug verwenden solltet.\n\nZuerst, ruft Euren Drachen herbei. Alternativ kann unser roter Drachenfreund hier Euch mitnehmen.\n\nDann fliegt durch die Ringe und landet am Zielort.\n\nWenn Ihr irgendwo festhngt, benutzt die bronzene Taschenuhr und Celormu wird Eure Position zurcksetzen.', '', '', '', '', '', '', 55664),
(80012, 'deDE', 'Drachenreiten', 'Nehmt Morataris Portal zu Lord Andestrasz.', 'Dieses Land ist grer, als ich es in Erinnerung hatte. Eine gute Gelehrte bereitet sich allerdings immer auf alle Eventualitten vor.\n\nZwei der im Flug versiertesten Drachen haben zugestimmt, uns zu helfen. Sie werden ein geflgeltes Reittier bereitstellen, damit Ihr grere Gebiete abdecken knnt.\n\nIch werde Euch zu Lord Andestrasz schicken. Er wird weitere Anweisungen fr Euch haben.', '', '', '', '', '', 'Sprecht mit Lord Andestrasz.', 55664),
(79440, 'deDE', 'Kriegserinnerungen', 'Bittet Eternus, Euch die Geschehnisse der Vergangenheit zu zeigen.', 'Unsere Angelegenheiten hier sind gesichert. Jedenfalls fr den Augenblick!\n\nDie Zeit ist gekommen, dass Ihr Eure Reise in die Vergangenheit antretet, damit wir beobachten knnen, wie sich die Geschichte entwickelt hat.\n\nSprecht mit Eternus, wenn Ihr noch letzte Fragen zu unserer Mission haben solltet. Sie kann Euch zeigen, wie diese Geschehnisse begannen.', '', '', '', '', '', '', 55664),
(79438, 'deDE', 'Ewiges Leben erschwert das Abschiednehmen', 'Besiegt Eratus, das entwebte Paradoxon.', 'Wir mssen uns um eine letzte Anomalie kmmern, bevor wir die Geschichte von Pandaria studieren knnen.\n\nHelft uns, den Zeitweg zu stabilisieren und unsere Mission zu sichern.', '', 'Wenn man sich an kosmischen Krften zu schaffen macht, kann das zu unvorhergesehenen Welleneffekten fhren. Eratus war sich darber stets im Klaren.', 'Eratus, das entwebte Paradoxon', '', '', '', 55664),
(79437, 'deDE', 'Knoten im Moment', 'Nutzt den Chronostabilisierer, um $1oa Zeitrisse zu schlieen.', 'Diese Zeitanomalien geraten langsam auer Kontrolle. Unsere Forschung trennt normalerweise die Zeitlinie nicht so weit auf. Ich denke, dass die anderen Ewigen die Schuld hieran tragen.\n\nNutzt diesen Chronostabilisierer, um die zerfetzten Risse zu schlieen.\n\nSeid auf der Hut: Dadurch knnen kurzfristig noch mehr Anomalien entstehen. Ich vertraue darauf, dass Ihr wisst, wie mit diesen umzugehen ist.', '', '', '', '', '', '', 55664),
(79435, 'deDE', 'Wie viel Uhr ist es bei Euch', 'Erwerbt ein Chronoabzeichen von Horos und sprecht dann mit Momentus.', 'Horos, unser Antiquittensammler, sollte ein Chronoabzeichen haben, das Ihr nutzen knnt, um die Zeitfden, die Ihr gesammelt habt, zusammenzufgen.\n\nMit einem Chronoabzeichen kann Momentus aus den Fden einen mchtigen Umhang weben, den Ihr tragen knnt!', '', '', '', '', '', '', 55664),
(79434, 'deDE', 'Doppelt gewebt hlt besser', 'Sammelt $1oa Zeitfden von ewigen Verheerern.', 'Die anderen Ewigen gehen nicht so umsichtig mit der Zeitlinie um. In ihrem waghalsigen Widerstand gegen unsere Bemhungen haben sie der Zeit Risse zugefgt.\n\nWir knnen die Zeitwege nicht einfach so flicken, aber wir knnen die losen Fden vielleicht noch zu anderen Zwecken nutzen.\n\nHolt Euch die Zeitfden von unseren Feinden zurck, dann werden wir Euch einen Umhang weben, der des ewigen Drachenschwarms wrdig ist.', '', '', '', '', '', '', 55664),
(79433, 'deDE', 'Der Rat einer Expertin', 'Sprecht mit Moratari.', 'Bringt diese Spule zu Moratari. Vielleicht wird sie aus diesem Relikt schlau.', '', '', '', '', '', 'Sprecht mit Moratari an der Zeitlosen Kste.', 55664),
(79432, 'deDE', 'Die Zeit ist gekommen', 'Ttet Archaios, den Konstrukteur.', 'Welch glcklicher Zufall, Euch jetzt hier zu treffen. Ich bentige Eure Hilfe.\n\nNicht alle Ewigen haben gesehen, was Nozdormu mir gezeigt hat. Nicht alle wrden zustimmen, selbst wenn sie es gesehen htten. Archaios ist einer dieser Kritiker. Er muss beseitigt werden.', '', 'Dieser Leutnant hat in seiner Gier nach temporalen Artefakten Kollateralschaden an der Zeitlinie verursacht.', 'Archaios, der Konstrukteur', '', '', '', 55664),
