(78679, 'deDE', 'Die Gabe der Entspannung', 'Sprecht mit Bordol Taugarten ber Entspannung und entspannt Euch dann an Olivias Teich in Sturmwind.', 'Selbstliebe umspannt viele verschiedene Formen. Gelegentlich auch die Form der Entspannung.\n\nDer Nachtelf beim Feuerwerk wirkt ausgesprochen entspannt.\n\nVielleicht knnt Ihr ihn zu seinen Erkenntnissen hinsichtlich Entspannung befragen.', '', '', '', '', '', 'Kehrt zu Bordol Taugarten auf der Gala der Geschenke zurck.', 55664),
