(78649, 'deDE', 'Ausgrabung: Etwas Groes unterm Flussbett', '', '', '', '', '', '', '', '', 55664),
(78369, 'deDE', 'Die Krone zerschmettern', 'Nutzt die Handwerk-Bon-Bomben, um Vorrte der Chemiemanufaktur Krone zu zerstren und Mitglieder der Chemiemanufaktur Krone auszuschalten.', 'Sieht aus, als htte Hummel Sicherheitsleute angeheuert. Aber keine Sorge, ich hab ein paar spezielle \"Geschenke\" dabei.\n\n<Schnappbolz zeigt auf die unbeschriftete Kiste.>\n\nBomben. Ich hab Bomben dabei.\n\nJetzt ist Schluss mit lustig. Nehmt diese Bomben und jagt damit Krone und ihre Vorrte in die Luft. Zeigt ihr, was ehrliche Handarbeit bedeutet. Sobald wir ihrem schmutzigen Geschft das Handwerk gelegt haben, knnen wir uns um Hummel kmmern.', '', '', '', '', '', '', 55664),
(76911, 'deDE', 'Forschung: Drakoniden der Kste des Erwachens', '', '', '', '', '', '', '', '', 55664),
