(55664, 'deDE', 'Tiefschlag fr die Moral', 'Unterbindet all Aktivitten im Repositorium der Shirakess.', 'Das ist die Quelle unserer gesamten Verderbnis. \n\nDie Kelfinnen werden hierhergebracht und gebrochen. \n\nTrefft sie, wo es ihnen wehtut. Brecht ihre Macht und ttet alle Naga, die Ihr seht. Absolute Zerstrung!\n\nJeder Nadelstich, den wir ihnen versetzen, wird sie mehr schwchen.', '', '', '', '', '', '', 55664),
