(31998, 'deDE', 'Eine wrdige Herausforderung: Sha des Zweifels', 'Schliet den Tempel der Jadeschlange im Herausforderungsmodus ab.', '$n, Ihr msst eine beherzte Gruppe zusammenstellen und sie in den Tempel der Jadeschlange fhren. Aktiviert die Kugel des Herausforderers und vernichtet das Sha des Zweifels.$B$BKehrt zu mir zurck, wenn Ihr diese Herausforderung bestanden habt, und ich werde Euch frstlich belohnen.', '', '', '', '', '', '', 55664),
(14420, 'deDE', 'Die Todespirscher', 'Beschafft Astors Vorstellungsschreiben und bringt es zu Mennet Carkad im Schurkenviertel.', 'Wenn Ihr Euch den Todespirschern anschlieen mchtet, der Elitewache der Dunklen Frstin, so msst Ihr Euren Wert beweisen.$b$bIch will Euch nichts vormachen, $n, diese Aufgabe knnte Euren Tod bedeuten.$b$bIch habe ein paar Angelegenheiten, die geregelt werden mssen. Ich bentige die persnlichen Habseligkeiten von Astor Hadren, einem Boten, der zwischen Silberwald und Unterstadt pendelt. Die Beschaffungsmethode berlasse ich ganz Euch.$b$bJe weniger Ihr ber diese Angelegenheit Bescheid wisst, desto besser. Wenn Ihr Erfolg habt, sage ich Euch mehr.', '', '', '', '', '', '', 55664),
(10788, 'deDE', 'Kehrt zu Talionia zurck', 'Sprecht mit Talionia in Silbermond.', 'Einer Eurer Meister, Talionia in Silbermond, schickt nach Euch, $n. Ich bin mir sicher, dass fr Euch die Zeit gekommen ist zu lernen, wie man einen mchtigeren Dmon beschwrt und kontrolliert. Ich schlage daher vor, dass Ihr Euch sofort auf den Weg macht. Wie ich wei befindet sich Talionia im Sanktum, einer gemtlichen kleinen Htte des Bsen an der Mrdergasse.', '', '', '', '', '', '', 55664),
(10490, 'deDE', 'Ruf des Wassers', 'Sprecht mit Scharfseher Nobundo in der Kristallhalle der Exodar auf der Azurmythosinsel.', 'Es ist schon eine Weile her, seitdem Ihr das letzte Mal auf die Probe gestellt wurdet. Scharfseher Nobundo hat nach Euch gefragt.$B$BIhr msst sehr viel an Erfahrung gewonnen haben, da man Euch nun die Geheimnisse des Elements des Wassers lehren mchte.$B$BIch nehme an, Ihr wisst noch, wie Ihr mit dem Boot von Auberdine an der Dunkelkste in Kalimdor aus zurck zur Exodar kommt? Und Ihr wisst noch, dass Ihr ihn in der Kristallhalle in der Exodar findet, ja?', '', '', '', '', '', '', 55664),
(9757, 'deDE', 'Sucht Jgerin Kella Nachtbogen auf', 'Sprecht mit Jgerin Kella Nachtbogen nahe Valaars Steg.', 'Jgerin Kella Nachtbogen hat um eine Audienz mit allen qualifizierten Jgern gebeten. Sie lehrt das Zhmen von wilden Tieren, etwas, das Ihr vor allem anderen zum jetzigen Zeitpunkt Eurer Ausbildung lernen solltet.$b$bIhr findet Kella in der Nhe von Valaars Steg, den Docks westlich der Exodar.', '', '', '', '', '', '', 55664),
(9735, 'deDE', 'Wahre Meister des Lichts', 'Bringt Lord Solanar in Silbermond eine Phiole heiligen Wassers von Tyrs Hand.', 'Ein Meister der Blutritter besitzt unglaubliche Fhigkeiten das Licht auf eine Art zu nutzen und zu formen, wie es die sogenannten anderen \'Paladine\' nie verstehen werden. Das hlt sie jedoch nicht davon ab, uns dafr zu chten, wie wir das wahre Potenzial des Lichts entfesseln.$B$BWir mssen ihnen klar machen, dass man mit unseresgleichen keine Spielchen spielt. Was ich mir vorgestellt habe, ist keine schnelle Angelegenheit und auch nicht einfach, doch wenn Ihr Euch dieser Aufgabe verpflichtet, wird es Euer erstes Ziel sein, den Bibliotheksflgel der Abtei von Tyrs Hand zu infiltrieren und eine Phiole heiligen Wassers von Tyrs Hand an Euch zu bringen.', '', '', '', '', '', '', 55664),
(9684, 'deDE', 'Die Beherrschung des Lichts', 'Wendet das schimmernde Gef auf die Magister der Blutelfen an, um es zu fllen und kehrt anschlieend zu Ritterfrst Heldenblut zurck.', 'Nehmt dieses Gef, $n. Durch die Erweckung seiner Verzauberung werdet Ihr in der Lage sein, die letzten berreste des Lichts, das diese Magister umgibt, fr Euch zu nutzen. Sie pflegten einst den gefangenen Naaru und tragen noch immer einen Teil von dessen Energie in sich.$B$BSorgt Euch nicht um die Magister, $n. Ich kmmere mich um ihr Wohlergehen. Lord Solanar hat mir versichert, dass Lady Liadrin selbst jetzt auf der Suche nach einer neuen Energiequelle ist.', '', '', '', '', '', '', 55664),
(9501, 'deDE', 'Ruf des Wassers', 'Sprecht mit Aqueous im Versteckten Riff bei der Blutmythosinsel.', 'Ein mchtiger Wasserelementar namens Aqueous hat nach Euch verlangt. Anscheinend ist das Element des Wassers auf der Blutmythosinsel aus dem Gleichgewicht geraten, was bei der unnatrlichen Vorliebe der Blutelfen nicht wirklich verwunderlich ist.$B$BIhr findet Aqueous in einem versteckten Riff unter den Wogen vor der Kste im Norden der Blutmythosinsel.$B$BNehmt diesen Trank, er wird Euch auf Eurem Weg zu Aqueous behilflich sein, sobald Ihr in der Nhe des Riffs im Wasser seid.', '', '', '', '', '', '', 55664),
(8909, 'deDE', 'Ein aufrichtiges Angebot', 'Sammelt 15 Blutproben aus Winterquell und bringt sie zusammen mit 20 Gold und einem Paar Armschienen des Glubigen zu Deliana in Eisenschmiede.', 'Seid gegrt, $C. Ich habe hier etwas, das Euch interessieren knnte.$B$BEs gleicht der Rstung, die von Leuten Eures Schlages bevorzugt wird, ist allerdings von weitaus hherer Qualitt. Fr einen kleinen Gefallen wre ich bereit, die Armschienen gegen die normalen einzutauschen.$B$BDas Blut der Frostsbler und Bren, die in Winterquell heimisch sind, hat gewisse Qualitten, die fr mich von Interesse sind. Bringt mir einen guten Vorrat davon und auerdem die Armschienen und etwas Gold. Ich versichere Euch, dass Eure Anstrengungen es wert sein werden.', '', '', '', '', '', '', 55664),
(8554, 'deDE', 'Negolash entgegentreten', 'Bringt 10 gegrillte Bussardflgel und 5 Flaschen Dschungelrankenwein zu Kpt\'n Smotts Rettungsboot.$B$BTtet Negolash und bringt Smotts\' Entersbel zu Kapitn Smotts ins Schlingendorntal.', 'Negolash ist ein hungriger Riese.$B$BAls die Riesen unser Schiff zerstrten, ging Negolash schnurstracks in meine Kombse. Er hatte keinen Appetit auf die Crew wie die anderen Riesen. Negolash wollte Wein... und meine gegrillten Bussardflgel. Die sind meine Spezialitt. Fr das Rezept musste ich bis ins dland reisen!$B$BWenn Ihr den Riesen anlocken wollt, dann besorgt Euch etwas Wein und einen Haufen Bussardflgel. Legt sie in unser altes Rettungsboot, an der Kste sdstlich von hier. Sobald Negolash das Essen riecht, wird er bestimmt kommen!', '', '', '', '', '', '', 55664),
(8378, 'deDE', 'Kriegsausrstung', '', '', '', '', '', '', '', '', 55664),
(7738, 'deDE', 'Perfekter Yetibalg', 'Bringt Jangdor Flinkschreiter im Camp Mojache in Feralas den perfekten Yetibalg.', 'Ihr habt einen Yetibalg gefunden, der beinahe perfekt scheint. Euch fllt schnell auf, dass dieser auergewhnlich dick und widerstandsfhig ist - sogar robuster als die Yetiblge aus der Wutschrammfeste.$B$BIn Anbetracht der Tatsache, dass Jangdor Flinkschreiter im Camp Mojache mit Yetiblgen handelt, drfte ihn dieser Fund besonders interessieren.', '', '', '', '', '', '', 55664),
(6584, 'deDE', 'Die Prfung der Schdel, Chronalis', 'Chronalis, ein Kind Nozdormus, bewacht die Hhlen der Zeit in der Tanariswste. Vernichtet ihn und bringt seinen Schdel zu Aschenschwinge.', 'Die Zeitbehter, Kinder Nozdormusss - Lord der Jahrhunderte...$B$BEs sind derer drei, die die Hhlen der Zeit bewachen, aber nur einer, an dem der schwarze Drachenschwarm interessiert ist: Chronalisss, der Zeitverschieber, bevorzugter Drachling Nozdormusss.$B$BBesssiegt diesssen Champion, denn das wre ein Schlag, der sssogar den stoischen Sand der Zzzeit erschttern wrde. Kehrt mit seinem Schdel zu mir zzzurck.', '', '', '', '', '', '', 55664),
(6583, 'deDE', 'Die Prfung der Schdel, Somnus', 'Vernichtet den Drachenchampion des grnen Drachenschwarms, Somnus. Nehmt seinen Schdel und bringt ihn zu Aschenschwinge zurck.', 'Genau wie unser Vater die Aspekte zerschmettert, mssen wir danach trachten, Chaos und Zerstrung unter ihren Kindern anzurichten.$B$BIhr msst Eure Leistungsfhigkeit im Kampf gegen die schlaflosen Trumer auf die Probe stellen: die Kinder des Grndrachenschwarms.$B$BBegebt Euch zu den Smpfen des Elends und sprt Somnus auf, den Drachenchampion des Grndrachenschwarms. Lasst Eurem Hass freien Lauf und bezwingt das Insekt...Kommt mit seinem Schdel zu mir zurck...', '', '', '', '', '', '', 55664),
(6582, 'deDE', 'Die Prfung der Schdel, Seher', 'Ihr msst Seher, den Champion der blauen Grodrachen, finden und ihn tten. Schlagt seinem Kadaver den Schdel ab und bringt ihn zu Aschenschwinge.$B$BIhr wisst, dass Seher in Winterquell zu finden ist.', 'Wir sind Kinder von Todesschwinge, Welpe. Wir mssen die Herrschaft ber die niederen Aspekte durchsetzen.$B$BWenn Ihr wirklich eines Aufstiegs wrdig seid, werden die Geringeren des Drachenschwarms vor Euch niedersinken.$B$BFindet deren Champions und vernichtet sie im Namen unseres Vaters!$B$BBegebt Euch nach Winterquell und sprt den mchtigen Blaudrachen Seher auf. Zerschmettert ihn und alle anderen des blauen Drachenschwarms, die sich Euch in den Weg stellen. Entreit ihm seinen Schdel und bringt ihn mir.', '', '', '', '', '', '', 55664),
(6145, 'deDE', 'Der Purpurrote Kurier', 'Kehrt in die stlichen Pestlnder zurck und sprt den Purpurroten Kurier auf. Ttet den Kurier und schnappt Euch den Befehl des Obersten Kreuzfahrers.$B$BBringt den Befehl zu Nathanos Pestrufer und wartet auf weitere Anweisungen.', 'So wie niemand ohne den Kopf berleben kann, kann der Kopf nicht ohne den Krper berleben. Die Verteidigungsanlagen des Scharlachroten Kreuzzugs in Stratholme sind fast unberwindbar. Stattdessen mssen wir den Krper unter dem Kopf abschneiden.$B$BMeine Todespirscher haben Daten ber die Aktivitten des Kreuzzugs auerhalb von Stratholme gesammelt. Jeden Tag wird ein Bericht aus ihrer Befehlszentrale nach Tyrs Hand geschickt. Dieser Bericht ist der Schlssel, $R! Sucht den Purpurroten Kurier und beschafft diesen Bericht. Bringt ihn zu Nathanos.', '', '', '', '', '', '', 55664),
(6126, 'deDE', 'Neue Lektionen', 'Reist zur Mondlichtung und sprecht mit Dendrite Sternenschauer im Dorf Nachthafen.', 'Ihr seid jetzt bereit, alles ber Gifte und die Macht zu lernen, die wir Druiden darber haben, $n. Cenarius hat uns mit der Fhigkeit gesegnet, selbst die abscheulichsten Gifte mit einer Beschwrung auszutreiben. Mit dieser Gabe geht man nicht leichtfertig um...und damit Ihr diese Lektion lernt, msst Ihr die Wirkung von Giften behandeln wie es ein Laie tun wrde.$B$BReist zur Mondlichtung und sprecht mit Dendrite Sternenschauer. Er erwartet Eure Ankunft, um die Lektion zu beginnen.', '', '', '', '', '', '', 55664),
(6121, 'deDE', 'Neue Lektionen', 'Reist zur Mondlichtung und sprecht mit Dendrite Sternenschauer im Dorf Nachthafen.', 'Ihr seid jetzt bereit, alles ber Gifte und die Macht zu lernen, die wir Druiden darber haben, $n. Cenarius hat uns mit der Fhigkeit gesegnet, selbst die abscheulichsten Gifte mit einer Beschwrung auszutreiben. Mit dieser Gabe geht man nicht leichtfertig um... und damit Ihr diese Lektion lernt, msst Ihr die Wirkung von Giften behandeln wie es ein Laie tun wrde.$B$BReist zur Mondlichtung und sprecht mit Dendrite Sternenschauer. Er erwartet Eure Ankunft, um die Lektion zu beginnen.', '', '', '', '', '', '', 55664),
(6084, 'deDE', 'Die Zhmung der Bestie', 'Benutzt die Zhmrute, um einen Schneeleoparden zu zhmen. bt Eure Fertigkeiten und kehrt dann zu Grif Wildherz in Kharanos zurck.', 'Diese Klippeneber sind recht bullig. Vielleicht mchtet Ihr etwas mit ein wenig mehr Grazie? Na gut, da hab ich genau das Richtige. Sdlich und stlich von hier findet Ihr groe weie Katzen, die man Schneeleoparden nennt. Genau wie bei einem elegant geschnitzten Gewehr verbirgt sich hinter dem wunderschnen ueren ein krftiger Kmpfer, der extremen Schaden zufgen kann. Ihr werdet feststellen, dass sie wesentlich agiler und schneller als Euer gezhmter Eber sind.$B$BNehmt diese Zhmrute und findet heraus, wie Euch der Schneeleopard gefllt.', 'Zhmt einen Schneeleoparden.', '', '', '', '', '', 55664),
(5926, 'deDE', 'Dem Ruf folgen', 'Sprecht mit Turak Runentotem auf der Anhhe der ltesten in Donnerfels.', 'Entschuldigung...$B$BEs ist mir zu Ohren gekommen, dass Turak Runentotem bekannt gegeben hat, dass er mit Euch sprechen mchte. Es scheint, dass Eure Ausbildung als Druide ein neues Gesicht bekommen soll und dass er Euch persnlich ausbilden will. Turak ist einer der Assistenten des Erzdruiden. Er ist als weiser und geduldiger Druide bekannt und wird Euch gut anleiten.$B$BEr befindet sich in Donnerfels, im Hauptzelt des Zirkels des Cenarius auf der Anhhe der ltesten.', '', '', '', '', '', '', 55664),
(5636, 'deDE', 'Verzweifeltes Gebet', 'Sprecht mit der Hohepriesterin Laurena in Sturmwind.', 'Elune segne Euch, $R. Ich hoffe, dass Euer Licht Euch findet und Euch heute gut schtzt.$B$BEiner Eurer Priester war vor nicht allzu langer Zeit hier und suchte nach Euch. Er erwhnte, dass Ihr sobald wie mglich zur Kathedrale des Lichts zurckkehren und mit der Hohepriesterin Laurena sprechen sollt. Es scheint, als httet Ihr Euch wacker geschlagen, dass Ihr eine solche Aufmerksamkeit erlangt. Ich wrde hier nicht allzu viel Zeit verbringen - Eure Leute brauchen Euch.', '', '', '', '', '', '', 55664),
(5146, 'deDE', 'Elementarlederverarbeitung', 'Bringt 2 Herzen des Feuers, 2 Kugeln des Wassers, 2 Erdenkerne und 2 Odem des Windes zu Brumn Winterhuf in den Arathibergen.$B$BWenn Ihr diese Aufgabe abschliet, werdet Ihr Zugang zur Kunst der Elementarlederverarbeitung erhalten.$B$BWenn Ihr diese Aufgabe abschliet, werdet Ihr allerdings weder Drachenlederverarbeitung noch Stammeslederverarbeitung erlernen knnen; seid also vorher sicher, dass dies der Weg ist, dem Ihr folgen wollt.', 'Elementarlederverarbeitung ist, was ich kann und wenn Ihr bereit seid, Eure Gedanken den greren Mchten der Substanz zu ffnen, werde ich mit Euch alles teilen, was es zu lernen gibt.$B$BDoch wisset dies, $C: Durch die Wahl dieses Weges erklrt Ihr Euch einverstanden, niemals die Kunst der Drachenlederverarbeitung oder der Stammeslederverarbeitung zu erlernen. Ihr knnt nur eine dieser drei Knste erlernen. Des Weiteren bentige ich einen angemessenen Beweis, dass Ihr im Einklang mit den Elementen der Natur steht. Bringt mir dafr die reinsten Essenzen von Feuer, Wasser, Erde und Wind.', '', '', '', '', '', '', 55664),
(3112, 'deDE', 'Einfaches Memorandum', 'Lest das einfache Memorandum und sprecht mit Thran Khorman im Eisklammtal.', 'Whrend Ihr unterwegs wart, um mir zu helfen, wurde mir dieses Memorandum fr Euch gegeben. Nehmt Euch die Zeit, es zu lesen, wenn Ihr die Gelegenheit dazu habt. Ich glaube, es kommt vom Kriegerlehrer Thran. Werft einen Blick darauf und sucht ihn dann in Ambossar auf, sobald Ihr die Gelegenheit dazu habt.', '', '', '', '', '', '', 55664),
(2993, 'deDE', 'Rckkehr ins Hinterland', 'Sprecht mit Greifenmeister Krallenaxt.', 'Scharfschnabel wird in einem Kfig hoch oben auf einer Klippe am Gipfel des Jintha\'Alor im Hinterland gefangen gehalten. Der Schlssel zu diesem Kfig ist im Besitz der Hohepriesterin der Blutfratzentrolle, der blen Priesterin Hexx.$B$BDa. Ich habe meinen Teil erfllt. Ich wnsche Euch Glck, $n.', '', '', '', '', '', '', 55664),
(2757, 'deDE', 'Auf nach Beutebucht!', 'Sprecht mit McGavan in Beutebucht.', 'Hrt mal, wenn Ihr hier herumhngt, lernt Ihr nix.$B$BIch kenn da so \'n Typen, der \'n Typen kennt. Der treibt sich bei der Schmiede in Beutebucht rum. Wenn Ihr ihm das Insigne hier zeigt, dann erzhlt er Euch alles ber Mithril.$B$BAlso, was sagt Ihr? berlasst diesen Babykram den Kleinkindern, $n - fr Euch ist es Zeit weiterzuziehen.$B$BFalls Ihr Interesse haben solltet, der Typ heit McGavan. Zeigt ihm das hier, dann wird er sehen, dass es Euch ernst ist.', '', '', '', '', '', '', 55664),
(1702, 'deDE', 'Der Schildschmied', 'Bringt das Fsslein mit Gerstenbru zu Furen Langbart.', 'Ihr habt echt gezeigt, aus welchem Holz Ihr geschnitzt seid, als Ihr am Rethbanspierutenlauf teilgenommen habt, $n. Und ich stehe zu meinem Wort. Ihr bekommt die versprochene Belohnung...$B$BAber sie ist in Sturmwind.$B$BSprecht mit meinem Freund Furen Langbart im Zwergendistrikt von Sturmwind. Er ist der beste Schildschmied, den Ihr je gesehen habt, und er schuldet mir einen groen Gefallen.$B$BHier, bringt Furen dieses Fsslein mit Gerstenbru und bittet ihn um einen Schild. Er wird Euch einen schnen geben.', '', '', '', '', '', '', 55664),
(1684, 'deDE', 'Elanaria', 'Sprecht mit Elanaria.', 'Seid gegrt, Krieger. Eure Fertigkeiten wachsen, doch Eurer Beruf verlangt mehr, als Ihr fr mglich haltet. Um weiter zu kommen msst Ihr bald einen Lehrer finden.$B$BDie Kriegerin Elanaria weilt in Darnassus auf der Terrasse der Krieger. Sie kann Euch unterweisen.', '', '', '', '', '', '', 55664),
(1520, 'deDE', 'Ruf der Erde', 'Sucht den Kodofels und trinkt das Erdsapta.', 'Ein Sapta ist ein Getrnk, mit dem unsere Seelen an die Elemente gebunden werden. Mit Magie gestrkt lsst dieses Elixier die, die offenen Geistes sind, die Elemente sehen, wie sie zuvor noch von niemandem gesehen wurden. Euer Geist wird ewig an das Element gebunden, fr das das Sapta geschaffen wurde. Nur wenige Auserwhlte unserer Art kennen das Geheimnis seiner Herstellung.$B$BDas Sapta wird stets an einem heiligen Ort getrunken und niemals anderswo.$B$BSucht den Schamanenschrein stlich von hier und trinkt von dem Sapta.', '', '', '', '', '', '', 55664),
(1485, 'deDE', 'ble Familiare', 'Bringt 6 Kpfe schndlicher Familiare zu Ruzan.', 'Die Hexenmeister, die vor uns kamen, weckten das Misstrauen der Horde. Man toleriert uns zwar, aber man liebt uns nicht.$b$bDas lie die Hexenmeister freilich nicht nher zusammenrcken, da viele in Abgeschiedenheit leben und ihre Magie allein erforschen. Ich will Euch nicht auf den einen oder anderen Weg fhren, sondern nur helfen, reifer zu werden.$b$bBevor ich Euch die Kunst des Beschwrens lehre, bringt mir sechs Kpfe der schndlichen Familiare aus der Hhle im Nordosten.', '', '', '', '', '', '', 55664),
(1188, 'deDE', 'Sicherheit zuerst', 'Bringt den Zephyriumnachbrenner zu Kainer nach Gadgetzan in Tanaris.', 'Doch wartet, was ist das? Kainer hat die Sicherung aktiviert gelassen. Das reduziert die Menge Energie, die ich aus dem Nachbrenner rausholen kann. Ich sagte ihm, ich wollte sie deaktiviert haben! Das ist nicht gut.$b$bIhr msst das ins Gadgetzan-Gizmorium in der Tanariswste bringen und es von Kainer entfernen lassen.', '', '', '', '', '', '', 55664),
(1159, 'deDE', 'Test der Lehre', 'Sucht Parqual Fintallas in Unterstadt.', 'Gut gemacht, $n. Ihr habt den ersten Teil des Tests der Lehren bestanden, aber es bleibt noch eine Frage zu beantworten. Aber es ist nicht an mir, diese Frage zu stellen.$B$BBesucht Parqual Fintallas in Lordaeron. Er war ein bedeutender Historiker der Menschen, bevor die Seuche ihn erwischte. Jetzt sucht er immer noch Erleuchtung, freilich einer ganz anderen Art.$B$BEr wird eine weitere Forderung an Euch stellen, bevor er Euch etwas fragt, aber Ihr habt Euch bisher meisterhaft geschlagen - ich bin sicher, Ihr werdet dieses Hindernis berwinden.', '', '', '', '', '', '', 55664),
(737, 'deDE', 'Verbotenes Wissen', 'Bringt Theldurin \'Yagyins Zusammenstellung\'.', 'Ich habe die Zusammenstellung fr Euch, $n. Ich muss Euch wohl nicht sagen, dass Ihr sie sorgfltig behandeln solltet. Und dass Ihr sie nicht in unfreundliche Hnde gelangen lassen solltet. $B$BDieses Buch enthlt viele Wahrheiten...$B$B... und die Wahrheit kann manchmal wehtun.', '', '', '', '', '', '', 55664);
